import './App.css';
import { CATEGORIES } from './data'
import TaskCategoryContainer from './Containers/TaskCategoryContainer'

class App extends React.Component {

  state = {
    Categories
  }

  render() {
    return (
      <div className="App">
        <h2>My tasks</h2>
        <TaskCategoryContainer />
      </div>
    );
  }
}


export default App;
